import React from "react";
import PieChartComponent from "./PieChartComponent";
import BarChartComponent from "./BarChartComponent";
import RouteLineChart from "./RouteLineChart";
import AgeGroupDetails from "./AgeGroupDetails";
import logo from "../assets/inflight-logo.png"; // ✅ Logo file

function Dashboard() {
  return (
    <div style={{ backgroundColor: "#ffffff", minHeight: "100vh", padding: "1rem 2rem" }}>
      {/* 🟦 Top Bar with Logo and Navigation */}
      <div
        style={{
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
          marginBottom: "2rem"
        }}
      >
        <div style={{ display: "flex", alignItems: "center", gap: "1rem" }}>
          <img src={logo} alt="InFlight Logo" style={{ width: "50px", height: "50px" }} />
          <h1 style={{ color: "#004e92", margin: 0 }}>In-Flight Insights Dashboard</h1>
        </div>
        <div style={{ display: "flex", gap: "2rem", fontWeight: "bold" }}>
          <span style={{ cursor: "pointer" }}>Dashboard</span>
          <span style={{ cursor: "pointer" }}>Reports</span>
          <span style={{ cursor: "pointer" }}>Savings</span>
        </div>
      </div>

      {/* 🟩 Key Performance Indicators */}
      <div
        style={{
          display: "flex",
          gap: "2rem",
          marginBottom: "2rem",
          justifyContent: "space-between"
        }}
      >
        <div
          style={{
            flex: 1,
            background: "linear-gradient(to right, #e0f7fa, #e0ffe0)",
            borderRadius: "12px",
            padding: "1.5rem",
            boxShadow: "0 4px 12px rgba(0,0,0,0.05)"
          }}
        >
          <h3>💰 Cost Savings</h3>
          <p style={{ fontSize: "1.8rem", fontWeight: "bold" }}>$1.2M</p>
        </div>
        <div
          style={{
            flex: 1,
            background: "linear-gradient(to right, #e0f7fa, #e0ffe0)",
            borderRadius: "12px",
            padding: "1.5rem",
            boxShadow: "0 4px 12px rgba(0,0,0,0.05)"
          }}
        >
          <h3>♻️ Waste Saved</h3>
          <p style={{ fontSize: "1.8rem", fontWeight: "bold" }}>210 kg</p>
        </div>
        <div
          style={{
            flex: 1,
            background: "linear-gradient(to right, #e0f7fa, #e0ffe0)",
            borderRadius: "12px",
            padding: "1.5rem",
            boxShadow: "0 4px 12px rgba(0,0,0,0.05)"
          }}
        >
          <h3>✈️ Routes Analyzed</h3>
          <p style={{ fontSize: "1.8rem", fontWeight: "bold" }}>350</p>
        </div>
      </div>

      {/* 🍽️ Pie & Line Charts Side by Side */}
      <div style={{ display: "flex", gap: "2rem", flexWrap: "wrap", marginBottom: "2rem" }}>
        <div style={{ flex: 1 }}>
          <h2>Overall Food Consumption</h2>
          <PieChartComponent />
        </div>
        <div style={{ flex: 1 }}>
          <h2>Route-Specific Waste Trend</h2>
          <RouteLineChart />
        </div>
      </div>

      {/* 📊 Bar Chart */}
      <div style={{ marginBottom: "2rem" }}>
        <h2>Waste by Age Group</h2>
        <BarChartComponent />
      </div>

      {/* 👥 Age Group Details */}
      <div>
        <h2>Age Group Details</h2>
        <p>[Details will be shown here on click of bar chart]</p>
        <AgeGroupDetails />
      </div>
    </div>
  );
}

export default Dashboard;
